import "./assets/styles/main.scss";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
    };
  }

  componentDidMount() {}
  render() {
    return (
      <>
        <section className="top">
          <form className="form">
            <div className="title">
              <h1>Add an Argonaut</h1>
            </div>
            <div className="form__container">
              <div className="form__registration">
                <p>name</p>
                <input className="form__input"></input>
              </div>
              <button className="form__button">Send</button>
            </div>
          </form>
        </section>
        <section className="bottom">
          <div className="title">
            <h1>Crew Members</h1>
          </div>
          <div>
            <div className="columns">
              <img className="columns__items" src="./col.jpg"></img>

              <img className="columns__items" src="./col.jpg"></img>

              <img className="columns__items" src="./col.jpg"></img>
            </div>
          </div>
          <div className="name-container"></div>
        </section>
        <footer></footer>
      </>
    );
  }
}

export default App;
